import React from 'react'
import styled from 'styled-components'



const CartSection = styled.div``;
const CartWrapper  = styled.div``;
const CartContainer  = styled.div``;

const Cart = ({ src, title, description, price }) => {
    return (
        <CartSection>
         <CartWrapper>

            <img src={src} alt="" />
            <CartContainer>
                <h2>{title}</h2>
                <h4>{description}</h4>
                <h3>{price}</h3>
            </CartContainer>

         </CartWrapper>
        </CartSection>

    )
}

export default Cart
